import "./Epic1.css";
import { MoreIcon } from "evergreen-ui";

function Epic1() {
    return (
        <div className="epics">
            <MoreIcon className="more_epic" />

            <p>Epic Rd </p>
        </div>
    );
}

export default Epic1;
